INSERT INTO `configtable` (`CFGId`, `CfgName`, `CfgText`) VALUES
(1, 'EmailLists', '// List of all distro list for volunteers\r\nAdm:Office Admin List\r\nBBB:BBB Event Committee\r\nCtr:Center List\r\nMnt:Center Mentor List\r\nObl:Oiled Bird Notify List\r\nOWCN:OWCN\r\nPV:PV List\r\nPVbu:PV Backup List\r\nSat:Home Rehab List\r\nTrn:Transporter List\r\nBBR:Baby Bird Rehabers\r\nWIW:WIW Committee'),
(2, 'MCTypes', '// list of member/contact types.  \r\n// first number corresponds with member/contact status (mcstatus)\r\n// the order defined will be order displayed in the form\r\n// first digit MUST correspond to the related mcstatus for form authorization use\r\n\r\n// 0-Donor:0-Donor\r\n// 0-Rescuer:0-Rescuer\r\n// 0-Proposed:0-Prposed Member\r\n// 1-IndorFamily:1-Individual or Family\r\n// 1-Benefactor:1-Benefactor\r\n// 1-Patron:1-Patron\r\n// 1-Sponsor:1-Sponsor\r\n// 1-Contributor:1-Contributor\r\n// 1-Supporter:1-Supporter\r\n// 1-Advocate:1-Advocate\r\n// 1-Sr-Student:1-Sr-Student\r\n// 1-LIFETIME:1-LIFETIME\r\n// 1-Subscriber:1-Subscriber\r\n2-Center:2-Center Volunteer\r\n2-Phone:2-Phone Volunteer\r\n2-Transporter:2-Transporter Volunteer\r\n2-Admin:2-Administrative Volunteer\r\n2-Other:2-Other\r\n// 3-Affiliate:3-Affiliate\r\n// 3-Company:3-Company\r\n// 3-Org:3-Org\r\n// 3-Agency:3-Agency\r\n// 3-Vet:3-VET'),
(3, 'Programs', '// list of donation programs\r\n// programs usually identify why the donor has gifted to PWC\r\n\r\n :---Dues Programs---\r\nDues-AnnualMbr:Annual Membership\r\nDues-Subscr:Subscribing Membership\r\nDues-Other:Other Dues (please note)\r\n :---Donaton Programs---\r\nDon-UnresDonation:Unrestricted Donation\r\nDon-IMO:In Memorandum (please note)\r\nDon-IHO:In Honor Of (please note)\r\nDon-Other:Other Donation (please note)\r\n :---Directed Donation Programs---\r\nDir-DirDonFunding:Directed Donation Funding\r\nDir-Other:Other-Directed Don. (please note)\r\n :---In-kind Donation Programs---\r\nInk-Facility:In-kind (Facility)\r\nInk-Food:In-kind (Food)\r\nInk-Meds:In-kind (Meds)\r\nInk-Other:Other In-kind (please note)\r\n :---Grant Programs---\r\nGra-GrantFunding:Grant Funding\r\nGra-Other:Other Grant (please note)\r\n :---Fund Raising Programs\r\nFun-Event:Event\r\nFun-Donation:Event Donation\r\nFun-Other:Other Fund Raising (please note)\r\n :---Program Income Programs\r\nPrg-Sales:Sales (t-shirts, cat collers, etc)\r\nPrg-EducPres:Education Presentation\r\nPrg-ExclProg:Exclusion Program\r\nPrg-Deposit:Deposit (please note)\r\nPrg-Other:Other Prog. Income (please note)\r\n\r\n'),
(4, 'Purposes', '// list of giving "Purposes"\r\n// NOTE: option for Dues payment automatically added\r\n\r\nDonation:Donation\r\nDirDon:Directed Donation\r\nInkindDon:In-Kind Doination\r\nGrant:Grant\r\nFundRaising:Fund Raising\r\nPrgIncome:Program Income\r\n'),
(5, 'CorrTypes', '// list of correspondence types\r\n// usually identifies what the correspondence was about\r\n// NOTE: option value="RenewalReminder" programatically added\r\n// NOTE: sending an MailReminder causes an auto update to corr log\r\n// NOTE: sending an EmailReminder causes an auto update to corr log\r\n\r\nRenewalTY:Renewal Thank You\r\nDonationTY:Donation Thank You\r\nNewMemberTY:New Member Thank You\r\n :---------Programs-------\r\nEOYTaxRcpt:EOYR TaxReceipt\r\nXmasCard:Xmas Card\r\nRecepFollowUp:Reception Follow Up\r\nPVPostcard:PV Postcard\r\nTourInvite:Tour Invitation\r\nOther:Other (please note)\r\n'),
(6, 'Campaigns', '// list of campaigns\r\n\r\n : \r\nMailedNotice:Mailed Notice\r\nEmailedNotice:EmailedNotice\r\nNewsletter:Newsletter\r\nEOYAppeal:End of Year Appeal\r\nFundOurVet:FundOurVet\r\nMedia:Radio/TV/News article\r\nOther:Other(please note)'),
(7, 'VolCategorys', '// volunteer categories\r\n\r\nCtrVol:Center Volunteer\r\nBBRoom:Baby Bird Rooom\r\nTransporter:Transporter\r\nHomeRehab:Home Rehabilitator\r\nOfficeAdmin:Office Administration\r\nPhoneVol:Phone Volunteer\r\nEvent:Event\r\nCommittee:Committee\r\nOther:Other (please note)\r\n\r\n');
